import React, { useState } from "react";
import "../styles/CadastroImovel.css";

const CadastroImovelAlugar = () => {
  const [imovel, setImovel] = useState({
    tipo: "",
    area: "",
    comodos: "",
    endereco: { pais: "", estado: "", cidade: "" },
    proprietario: { nome: "", email: "", contato: "" },
    corretor: { nome: "", email: "", contato: "" },
  });

  const [showMessage, setShowMessage] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;

    if (name.startsWith("endereco.")) {
      const [, key] = name.split(".");
      setImovel((prev) => ({
        ...prev,
        endereco: { ...prev.endereco, [key]: value },
      }));
    } else if (name.startsWith("proprietario.") || name.startsWith("corretor.")) {
      const [section, key] = name.split(".");
      setImovel((prev) => ({
        ...prev,
        [section]: { ...prev[section], [key]: value },
      }));
    } else {
      setImovel((prev) => ({ ...prev, [name]: value }));
    }
  };

  const handleCadastrar = async (event) => {
    event.preventDefault();

    try {
      await fetch("http://localhost:5000/alugar", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(imovel),
      });
      setShowMessage(true);
      setTimeout(() => setShowMessage(false), 3000);
    } catch (error) {
      console.error("Erro ao cadastrar imóvel para aluguel:", error);
    }
  };

  return (
    <div className="container">
      <header className="headerCi">
        <h1>Cadastro do Imóvel para Alugar</h1>
      </header>
      <div className="form-container">
        <form onSubmit={handleCadastrar}>
          <section>
            <h3>Dados do Imóvel</h3>
            <div className="form-group">
              <input
                type="text"
                name="tipo"
                placeholder="Tipo do Imóvel"
                onChange={handleChange}
                required
              />
              <input
                type="text"
                name="area"
                placeholder="Área do Imóvel"
                onChange={handleChange}
                required
              />
              <input
                type="number"
                name="comodos"
                placeholder="Quantidade de Cômodos"
                onChange={handleChange}
                required
              />
            </div>
            <h3>Endereço</h3>
            <div className="form-group">
              <input
                type="text"
                name="endereco.pais"
                placeholder="País"
                onChange={handleChange}
                required
              />
              <input
                type="text"
                name="endereco.estado"
                placeholder="Estado"
                onChange={handleChange}
                required
              />
              <input
                type="text"
                name="endereco.cidade"
                placeholder="Cidade"
                onChange={handleChange}
                required
              />
            </div>
          </section>
          <section>
            <h3>Proprietário</h3>
            <div className="form-group">
              <input
                type="text"
                name="proprietario.nome"
                placeholder="Nome"
                onChange={handleChange}
                required
              />
              <input
                type="email"
                name="proprietario.email"
                placeholder="Email"
                onChange={handleChange}
                required
              />
              <input
                type="text"
                name="proprietario.contato"
                placeholder="Contato"
                onChange={handleChange}
                required
              />
            </div>
          </section>
          <section>
            <h3>Corretor</h3>
            <div className="form-group">
              <input
                type="text"
                name="corretor.nome"
                placeholder="Nome"
                onChange={handleChange}
                required
              />
              <input
                type="email"
                name="corretor.email"
                placeholder="Email"
                onChange={handleChange}
                required
              />
              <input
                type="text"
                name="corretor.contato"
                placeholder="Contato"
                onChange={handleChange}
                required
              />
            </div>
          </section>
          <div className="form-actions">
            <button type="submit" className="btn-submit">
              Cadastrar Imóvel
            </button>
          </div>
        </form>
        {showMessage && <div className="confirmation-message">Imóvel cadastrado com sucesso!</div>}
      </div>
    </div>
  );
};

export default CadastroImovelAlugar;
